import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="container text-center mt-5">
      <h1 className="display-4 mb-3 text-primary">Welcome to CleanSwift</h1>
      <p className="lead mb-4">Reliable & affordable home cleaning services tailored to your needs.</p>

      <div className="d-flex flex-wrap justify-content-center gap-3 mb-5">
        <Link to="/services" className="btn btn-outline-primary btn-lg">View Services</Link>
        <Link to="/booking" className="btn btn-success btn-lg">Book Now</Link>
        <Link to="/about" className="btn btn-outline-info btn-lg">About Us</Link>
        <Link to="/contact" className="btn btn-outline-dark btn-lg">Contact</Link>
      </div>

      <img
        src="https://www.shutterstock.com/image-vector/spring-cleaning-lettering-home-cleanup-600nw-2430121055.jpg"
        alt="Home Cleaning"
        className="img-fluid rounded shadow-sm"
        style={{ maxHeight: '400px',width:'1500px' }}
      />
    </div>
  );
};

export default Home;
